import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { Button, Container, Row, Col } from "react-bootstrap";
import { useNavigate } from "react-router-dom";

import piloteActions from "../../redux/actions/piloteActions";
import { getPilotes } from "../../redux/reducers/piloteReducer";

export function Pilotes() {
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const pilotes = useSelector(getPilotes);

  useEffect(() => {
    dispatch(piloteActions.getPilotes());
  }, [dispatch]);

  const onClickCreate = () => navigate("/pilotes/creer-pilote");

  return (
    <div className="Pilotes">
      <h2 className="title-page">Pilotes</h2>
      <Container>
        <Row>
          <Col md={{ span: 2, offset: 10 }}>
            <Button variant="outline-primary" onClick={onClickCreate}>
              Cr√©er un pilote
            </Button>
          </Col>
        </Row>
      </Container>

      {pilotes.map(pilote => {
        return (
          <>
            <p>{`${pilote.nomPilote} - ${pilote.ecuriePilote}`}</p>
          </>
        );
      })}
    </div>
  );
}
